import React from "react";
import { Card, Col, Row, Icon, Avatar } from 'antd';
import { Modal, Button } from 'antd';
const { Meta } = Card;

class LayerOptions extends React.Component {
  state = { visible: false }

  test = () => {
    console.log("Test")
  }

  showModal = () => {
    this.setState({
      visible: true,
    });
  }

  handleOk = (e) => {
    console.log(e);
    this.setState({
      visible: false,
    });
  }

  handleCancel = (e) => {
    console.log(e);
    this.setState({
      visible: false,
    });
  }

  render() {
    return (
      <div>
        <Col span={8}>
          <Card
            style={{ width: 200 }}
            actions={[<Icon type="picture" onClick={this.showModal} />, <Icon type="plus-square" />]}
          >
            <Meta
              title="Al Basrah AAS v1"
              description={(
                <Row type="flex" justify="center">
                  <Col span={8}>
                    <img src="/images/US_Flag.png" style={{ width: 50, heigth: 25 }}></img>
                  </Col>
                  <Col span={2}></Col>
                  <Col span={4} >
                    <span style={{textAlign: "center", margin: "0 15"}}>VS.</span>
                  </Col>
                  <Col span={2}></Col>
                  <Col span={8}>
                    <img src="/images/US_Flag.png" style={{ width: 50, heigth: 25 }}></img>
                  </Col>
                </Row>
              )}
            />
          </Card>
          <Modal
            title="Basic Modal"
            visible={this.state.visible}
            onOk={this.handleOk}
            onCancel={this.handleCancel}
            footer={[
              <Button key="ok" type="primary" onClick={this.handleOk}>
                Close
            </Button>
            ]}
          >
            <p>Some contents...</p>
            <p>Some contents...</p>
            <p>Some contents...</p>
          </Modal>
        </Col>


      </div>
    )
  }

}


export default LayerOptions;
